script: |
  super -f tsv -I q7159.sql | sort > q7159.out

vector: true

inputs:
  - name: q7159.sql
    data: |
      SELECT 73 AS col0 FROM tab0 cor0 WHERE + col2 * - col0 * 33 + - ( 86 ) NOT BETWEEN - col1 - col1 * col2 AND - col2 / col1;
  - name: tab0

outputs:
  - name: q7159.out
    data: |
      73
      73
      73
